import AppLayout from "../componets/AppLayout";

import Head from 'next/head';


const Home = () => {
    return (
        <>
        <Head>
            <title>Node Bird</title>
        </Head>
        <AppLayout>       
            <div>
                <h1>Hello, Next</h1>
            </div>
        </AppLayout>
        </>
    );
}

export default Home;
